const test = require('ava');
const sinon = require('sinon');
const proxyquire = require('proxyquire');

const metricFixtures = require('./fixtures/metric');
const agentFixtures = require('./fixtures/agent');

let config = {
  logging() {}
};

let uuid = 'yyy-yyy-yyy';
let type = 'CPU';
let MetricStub = null;
let AgentStub = null;
let db = null;
let sandbox = null;

let uuidArgs = {
  where: { uuid }
};

let metricUuidArgs = {
  attributes: ['type'],
  group: ['type'],
  include: [{
    attributes: [],
    model: AgentStub,
    where: {
      uuid
    }
  }],
  raw: true
};

let typeUuidArgs = {
  attributes: ['id', 'type', 'value', 'createdAt'],
  where: {
    type
  },
  limit: 20,
  order: [['createdAt', 'DESC']],
  include: [{
    attributes: [],
    model: AgentStub,
    where: {
      uuid
    }
  }],
  raw: true
};

let newMetric = {
  agentId: 1,
  type: 'CPU',
  value: '18%'
};

test.beforeEach(async () => {
  sandbox = sinon.sandbox.create();

  MetricStub = {
    belongsTo: sinon.spy()
  };

  AgentStub = {
    hasMany: sinon.spy()

    // Model create Stub
  };AgentStub.findOne = sandbox.stub();
  AgentStub.findOne.withArgs(uuidArgs).returns(Promise.resolve(agentFixtures.byUuid(uuid)));

  MetricStub.create = sandbox.stub();
  MetricStub.create.withArgs(newMetric).returns(Promise.resolve({
    toJSON() {
      return newMetric;
    }
  }));

  metricUuidArgs.include[0].model = AgentStub;
  typeUuidArgs.include[0].model = AgentStub;

  // Model findAll Stub
  MetricStub.findAll = sandbox.stub();
  MetricStub.findAll.withArgs().returns(Promise.resolve(metricFixtures.all));
  MetricStub.findAll.withArgs(metricUuidArgs).returns(Promise.resolve(metricFixtures.findByAgentUuid(uuid)));
  MetricStub.findAll.withArgs(typeUuidArgs).returns(Promise.resolve(metricFixtures.findByTypeAgentUuid(type, uuid)));

  const setupDatabase = proxyquire('../', {
    './models/agent': () => AgentStub,
    './models/metric': () => MetricStub
  });

  db = await setupDatabase(config);
});

test.afterEach(() => {
  sandbox && sinon.sandbox.restore();
});

